inline double predictDipoleMoment(const std::vector<double>& osmordred,
                          const std::vector<double>& meta37,
                          const std::vector<double>& abrahamv2) {
    std::vector<double> features;
    features.reserve(200);
    
    for (int idx : DIPOLEMOMENT_OSMO_INDICES) {
        features.push_back(idx >= 0 && idx < static_cast<int>(osmordred.size()) ? osmordred[idx] : 0.0);
    }
    for (int idx : DIPOLEMOMENT_META37_INDICES) {
        features.push_back(idx >= 0 && idx < static_cast<int>(meta37.size()) ? meta37[idx] : 0.0);
    }
    for (int idx : DIPOLEMOMENT_AV2_INDICES) {
        features.push_back(idx >= 0 && idx < static_cast<int>(abrahamv2.size()) ? abrahamv2[idx] : 0.0);
    }
    
    double prediction = DIPOLEMOMENT_BASE_SCORE;
    for (const auto& tree : DIPOLEMOMENT_TREES) {
        int node = 0;
        while (tree[node].feature >= 0) {
            node = features[tree[node].feature] <= tree[node].threshold ? tree[node].left : tree[node].right;
        }
        prediction += DIPOLEMOMENT_LEARNING_RATE * tree[node].value;
    }
    return prediction;
}

